import React from 'react';
import Extractor from '../../api/comment-extractor/extractor'
import {
    CommentExtractorContainer,
    LogoContainer
} from './comment-extractor.styles'


const CommentExtractor = () => {
    return (
        <CommentExtractorContainer>
            <LogoContainer />
            <Extractor />
        </CommentExtractorContainer>
    )
}

export default CommentExtractor;
